package p01Control;

public class C08For {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		System.out.println(1);
		
		System.out.println(2);
		
		int cnt=0;
		for(int j=0;j<2;j++) {
			for(int i=0;i<3;i++) {
				System.out.println(3);
				System.out.println(4);
				cnt++;
			}
		}
		System.out.println(cnt);
		
		System.out.println(5);
	}

}
